import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwTabContainer from 'viewmodel/AwTabContainerViewModel';
import AwTab from 'viewmodel/AwTabViewModel';
import AwInclude from 'viewmodel/AwIncludeViewModel';
import { ExistWhen } from 'js/hocCollection';
const DivExistWhen = ExistWhen('div');
const AwIncludeExistWhen = ExistWhen(AwInclude);



/*
ctx imports
*/
import { getContext as context } from 'js/AwSelectionSummaryService';
import { getVisibleTabs as visibleTabs } from 'js/AwSelectionSummaryService';
const ctxImportObj = { context,visibleTabs };


/*
dynamic import
 */
registerDynImportEntry('js/AwSelectionSummaryService', () => import('js/AwSelectionSummaryService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "getTabToActivateAndVisibleTabs": {
            "actionType": "JSFunctionAsync",
            "method": "getTabToActivateAndVisibleTabs",
            "inputData": {
                "data": "{{data}}",
                "props": "{{props}}",
                "allVisibleTabs": "{{data.ctx.visibleTabs}}"
            },
            "outputData": {
                "summaryContext": "summaryContext"
            },
            "deps": "js/AwSelectionSummaryService"
        },
        "syncSublocationState": {
            "actionType": "JSFunction",
            "method": "syncSublocationState",
            "inputData": {
                "activeTab": "{{data.summaryContext.activeTab}}",
                "sublocationState": "{{props.context.pageContext.sublocationState}}"
            },
            "deps": "js/AwSelectionSummaryService"
        },
        "clearSublocationState": {
            "actionType": "JSFunction",
            "method": "clearSublocationState",
            "inputData": {
                "sublocationState": "{{props.context.pageContext.sublocationState}}"
            },
            "deps": "js/AwSelectionSummaryService"
        }
    },
    "lifecycleHooks": {
        "onMount": "getTabToActivateAndVisibleTabs",
        "onUpdate": [
            {
                "action": "syncSublocationState",
                "observers": [
                    "viewModel.data.summaryContext.activeTab.tabKey",
                    "viewModel.data.summaryContext.activeTab.view"
                ]
            },
            {
                "action": "getTabToActivateAndVisibleTabs",
                "observers": [
                    "viewModel.ctx.visibleTabs",
                    "props.selection.uid",
                    "props.selection[0].uid",
                    "props.selection.length",
                    "props.context.pageContext.sublocationState.secondaryActiveTabId"
                ]
            }
        ],
        "onUnmount": "clearSublocationState"
    },
    "ctx": {
        "context": {
            "parser": {
                "method": "getContext",
                "deps": "js/AwSelectionSummaryService"
            }
        },
        "visibleTabs": {
            "parser": {
                "method": "getVisibleTabs",
                "deps": "js/AwSelectionSummaryService"
            }
        }
    },
    "props": {
        "selection": {
            "type": "object"
        },
        "context": {
            "type": "object"
        },
        "selection-data": {
            "type": "object"
        },
        "tabs-config": {
            "type": "object"
        },
        "ctx-parameters": {
            "type": "object"
        },
        "additional-parameters": {
            "type": "object"
        }
    },
    "_viewModelId": "AwSelectionSummaryInternal",
    "_uniqueViewModelId": "AwSelectionSummaryInternal"
};

/*
<div class='aw-xrt-summaryXrt' exist-when="data.summaryContext && data.summaryContext.activeTab && data.summaryContext.visibleTabs.length > 0">
    <div class='aw-xrt-tabsContainer' exist-when="(data.summaryContext && data.summaryContext.activeTab && data.summaryContext.visibleTabs) && ((data.summaryContext.activeTab.tabContent === undefined && data.summaryContext.visibleTabs.length > 1) || (data.summaryContext.activeTab.tabContent !== undefined))">
        <aw-tab-container tab-container-model="data.summaryContext.visibleTabs" callback="data.summaryContext.api" tab-set-id="{{props.context.tabSetId ? props.context.tabSetId : 'secondary'}}">
            <aw-tab tab-model='tab' aw-repeat='tab: data.summaryContext.visibleTabs'></aw-tab>
        </aw-tab-container>
    </div>
    <div class='aw-widgets-multiSelectContainer'>
        <aw-include name="{{data.summaryContext.activeTab.view}}" sub-panel-context="props.ctx.context[0]" exist-when="data.summaryContext && data.summaryContext.activeTab && data.summaryContext.activeTab.view"></aw-include>
    </div>
</div>

