    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <DivExistWhen className="aw-xrt-summaryXrt" existWhen={AwParseService.instance( "data.summaryContext && data.summaryContext.activeTab && data.summaryContext.visibleTabs.length > 0" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
        <DivExistWhen className="aw-xrt-tabsContainer" existWhen={AwParseService.instance( "(data.summaryContext && data.summaryContext.activeTab && data.summaryContext.visibleTabs) && ((data.summaryContext.activeTab.tabContent === undefined && data.summaryContext.visibleTabs.length > 1) || (data.summaryContext.activeTab.tabContent !== undefined))" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            <AwTabContainer tabContainerModel={AwParseService.instance( "data.summaryContext.visibleTabs" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} callback={AwParseService.instance( "data.summaryContext.api" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} tabSetId={AwParseService.instance( "props.context.tabSetId ? props.context.tabSetId : 'secondary'" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                { Object.entries( AwParseService.instance( "data.summaryContext.visibleTabs" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } ) || [] ).map( ( [ $index, tab ] ) => (
                    <AwTab tabModel={AwParseService.instance( "tab" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports, tab, $index } )} key={$index}>
                    </AwTab>
                ) ) }
            </AwTabContainer>
        </DivExistWhen>
        <div className="aw-widgets-multiSelectContainer">
            <AwIncludeExistWhen viewId={AwParseService.instance( "data.summaryContext.activeTab.view" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} viewPath={AwParseService.instance( "viewPath" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} name={AwParseService.instance( "data.summaryContext.activeTab.view" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "props.ctx.context[0]" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "data.summaryContext && data.summaryContext.activeTab && data.summaryContext.activeTab.view" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwIncludeExistWhen>
        </div>
    </DivExistWhen>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
